import React from "react";

const MyCollapse = ({ product, href }) => {
  return (
    <div>
      <a
        data-toggle="collapse"
        href={"#" + href}
        role="button"
        aria-expanded="false"
        aria-controls="collapseExample"
      >
        商品介紹
      </a>

      <div className="collapse" id={href}>
        <textarea
          id="desc"
          rows="3"
          cols="33"
          value={product.desc}
          readOnly
          disabled
        ></textarea>
      </div>
    </div>
  );
};

export default MyCollapse;
